import React from 'react'

const CrearUsuario = () => {

    const saveUsuarios = e =>{
        console.log(e);
        e.preventDefault();
    }

    return(<div>
        <h4>Nuevo Usuario</h4>
        <form onSubmit={saveUsuarios}>
            <label>Nombre</label>
            <input />
            <label>Apeido</label>
            <input />
            <input type='file' />
        </form>
    </div>);
}

export default CrearUsuario;
